import React from 'react';
import './Page.css'; // Import the CSS file for page styling

const Assistance = () => {
    return (
        <div className="page-content">
            <h1>Assistance Page</h1>
            <p>This is the assistance page of our application.</p>
        </div>
    );
};

export default Assistance;
